import React from 'react';
import './FilterBar.css'; // Import styles for the filter bar

const FilterBar = () => {
  return (
    <div className="filter-bar">
      <h3>Filter Products</h3>
      <div className="filter-option">
        <label>
          <input type="checkbox" />
          Category 1
        </label>
      </div>
      <div className="filter-option">
        <label>
          <input type="checkbox" />
          Category 2
        </label>
      </div>
      <div className="filter-option">
        <label>
          <input type="checkbox" />
          Category 3
        </label>
      </div>
      {/* Add more filters as needed */}
    </div>
  );
};

export default FilterBar;
